INSERT INTO `consult` VALUES ('1', '订购中国名乡名镇志', '谭林', '13885353399', '409209196@qq.com', null, '本地史志办申报中国名乡名镇志,欲订购兄弟县区《中国名乡名镇志》一套作借鉴参考学习。', '2015-06-18 21:25:12', '2015-06-19 11:25:58', '请与方志出版社发行部联系，电话：010-67110500 ', '1', '1', '0');
INSERT INTO `consult` VALUES ('2', '怎样向《中国地方志》期刊投稿', '杜崇文', '13908804078', 'dcw651230@126.com', null, '我是云南省昆明市富民县史志办主任。近期我们收到一位地方志爱好者的两篇文章，这两篇文章通过对云南省特别是富民县的历史研究，对已出版的《富民县志》中有关建置沿革的记载提出不同意见，经我们核实，这位爱好者的意见是正确的，经批准，我们对富民县的建置沿革重新进行了修订。这两篇文章我们认为具有一定的地方志学术价值，想推荐给《中国地方志》不知该怎样办理？谢谢！', '2015-07-20 21:27:03', '2015-07-22 09:39:15', '请与《中国地方志》编辑部联系，电话：010-65275972 ', '1', '1', '0');
INSERT INTO `consult` VALUES ('3', '怎么向《中国地方志》投稿', '朱传成', '18653035539', '21501234@163.com', null, '请问邮箱或投寄地址', '2015-10-08 11:27:53', '2015-10-09 10:39:05', '请与《中国地方志》编辑部联系，电话：010-65275972 ', '1', '1', '0');
INSERT INTO `consult` VALUES ('4', '网站布局建议', '马俊明', '18638944731', 'mjm12@126.com', null, '我是方志网的忠实用户。在使用中，我感到领导讲话分散于工作要闻之中，不便于阅读。建议将领导讲话分门别类，设置专栏发布。一来便于有效搜索，二来能够看到领导讲话前后发展脉络，分析史志工作发展趋势，指导工作实践。', '2015-12-01 13:28:52', '2015-12-03 11:38:52', '中国方志网在下一步的改版中会予以考虑，谢谢您的建议 ', '1', '1', '0');
INSERT INTO `consult` VALUES ('5', '如何向贵网投稿', '陈敏', '13806617818', '749996098@qq.com', null, '向贵网投稿的联系人、电话、网址、邮箱等，恳请给予回复为荷。', '2016-04-08 21:29:33', '2019-04-09 21:38:40', '请投稿至中指办信息处邮箱：xinxichu521@sina.com ', '1', '1', '0');
INSERT INTO `consult` VALUES ('6', '咨询', '精彩份额', '15210086545', '375171197@qq.com', null, '想查询一下大同市的地方志。', '2018-07-10 21:31:10', '2018-07-12 21:38:28', '由于国家方志馆馆藏还未对外开放，请与大同市地方志办公室联系 ', '1', '1', '0');
INSERT INTO `consult` VALUES ('7', '索取资料', '徐建功', '010-68722136', 'bjkjz007@sina.com', null, '我是中关村国家自主创新示范区志鉴编辑部的，希望能看到《全国年鉴工作、中国年鉴精品工程试点管理暂行办法》', '2018-11-30 21:32:27', '2018-12-01 21:38:15', '目前还没有发布 。', '1', '1', '0');
INSERT INTO `consult` VALUES ('8', '中国国情网何时开通', '周海静', '18511234557', 'yang7710@sina.com', null, '我想了解一下各地的情况，贵单位已计划启动中国国情网建设，请问网站何时开通？', '2019-03-02 21:33:04', '2019-03-04 21:38:00', '拟定在2017年年底 。', '1', '1', '0');
INSERT INTO `consult` VALUES ('9', '国家方志馆何时开馆', '征服', '010-87860405', 'yang7710@163.com', null, '我想查询一些地方志，请问国家方志馆何时对外开放。', '2019-04-18 07:33:34', '2019-04-18 11:37:44', '国家方志馆“方志中国”展览已于今年5月13日开展，国家方志馆“魅力中国”展览拟于明年上半年开展，国家方志馆开馆的相关工作正在积极推进。', '1', '1', '0');
INSERT INTO `consult` VALUES ('10', '方志馆布展', '童黄培', '18255186338', '114089756@qq.com', null, '我们县现在兴建了方志馆，可是布展上，我们缺乏经验，所以，请问有没有哪个地方的方志馆布展比较好的，请给我我们提供一下线索，便于我们参观学习。', '2019-06-07 07:34:11', '2019-06-08 10:37:20', '东营市方志馆，广州市方志馆，广东省方志馆 。', '1', '1', '0');
INSERT INTO `consult` VALUES ('11', '名镇名村志如何编纂', '孙福爱', '15551563776', 'lxzb2011@126.com', null, '我是安徽省亳州市利辛县地方志办公室工作人员，我县已上报一镇二村编写名镇名村志，但缺少编写经验。能否请中指组给予指点？', '2019-07-20 10:34:47', '2019-07-20 21:36:41', '你好，请与中国地方志指导小组办公室方志处联系，联系电话：010-65251941。感谢你对我们工作的支持。 ', '1', '1', '0');
INSERT INTO `consult` VALUES ('12', '网上如何投新闻稿件', '尹涛', '15991057867', '936705678@qq.com', null, '网上如何投新闻稿件', '2019-08-11 18:30:23', '2019-11-27 12:41:48', '你好，请将稿件投到xinxichu521@sina.com，或者点击中国方志网右下角“在线投稿”，注册后按要求投稿。感谢你对我们工作的支持，并欢迎你踊跃投稿。 ', '1', '1', '0');
INSERT INTO `consult` VALUES ('13', '北京市地方志办公室在哪？', '小王', '13698923872', '13698923872@139.com', null, '北京市地方志办公室在哪？', '2018-09-22 21:35:52', '2018-09-23 09:36:17', '北京市地方志办公室位于北京市朝阳区东三环南路88号北京市方志馆,邮编：100021，电话：87665765。', '1', '1', '0');
INSERT INTO `consult` VALUES ('14', '11', '11', '11', '11@qq.com', null, '11', '2019-11-15 21:47:47', null, null, '2', '2', '0');
INSERT INTO `consult` VALUES ('15', '贵单位藏书开放了吗', '王先生', '13215982534', 'wangqq@qq.com', null, '想去查地方志，不知道藏书是否开放了？', '2019-11-27 22:41:58', '2019-11-28 09:14:30', '您好，国家方志馆目前正在改造装修，馆藏书目暂时无法向社会公众开放。', '1', '1', '0');
INSERT INTO `consult` VALUES ('16', '关于湖北省地方志', '贺子洋', '18281921127', '461040714@qq.com', '中国地质大学（武汉）', '请问湖北省地方志、鄂州市志、鄂州各区地方志、宜昌市志、宜昌市各区地方志在哪里可以下载电子版？', '2019-11-28 01:05:52', '2019-11-28 09:18:57', '旧志可前往目前成型的古籍数据库查询，但您所提的新志很多还没有修完，尚无对公众开放的电子书下载渠道。', '1', '1', '0');
INSERT INTO `consult` VALUES ('17', '宁夏历年年鉴', '赵小玥', '13991103337', '1255071669@qq.com', null, '你好，我是一名高校博士生，最近研究需要浏览宁夏自治区2000年至2018年的年鉴，但其官网无法打开，在网上找不到关于宁夏年鉴的内容信息，请问能否提供2000年至2018年宁夏年鉴的电子版，谢谢。', '2019-11-28 20:13:39', '2019-11-29 12:31:40', '你好，我们目前也没有各地修编年鉴的电子版。据知，宁夏地方志官网很早就打不开了。你可直接联系宁夏地方志办公室，或者联系当地的图书馆看是否有藏。', '1', '1', '0');
INSERT INTO `consult` VALUES ('18', '如何办理入会？', '卢达', '13991261811', '43702726@qq.com', '长庆油田', '您好，请问企业是否可以办理入会？', '2019-12-03 09:16:42', '2019-12-04 12:31:31', '入什么会呢？', '1', '0', '0');
INSERT INTO `consult` VALUES ('19', '投稿时出现用户被锁定，请解锁后登录', '李金桃', '13847754999', '596470938@qq.com', null, '投稿时出现用户被锁定，请解锁后登录', '2019-12-05 10:16:10', '2019-12-21 15:10:13', '已经调整，请您再试看看。谢谢您对我们工作的支持。', '1', '3', '0');
INSERT INTO `consult` VALUES ('20', '我们怎么投稿', '王先生', '13693185643', 'wangchaodfz@163.com', null, '我们怎么投稿', '2019-12-05 11:04:18', '2019-12-05 11:05:37', 'nishishi', '2', '2', '0');
INSERT INTO `consult` VALUES ('21', 'wangchaod 地方志', '王超', '13693185643', 'wangchaodfz@sina.com', null, '1aaaaaaad', '2019-12-05 11:07:07', '2019-12-05 11:07:52', '123456', '2', '2', '0');
INSERT INTO `consult` VALUES ('22', '如何进入在线统计系统', '王先生', '13713211352', '274848797@qq.com', null, '如何进入在线统计系统进行填报', '2019-12-17 20:36:34', '2019-12-21 17:18:05', '需要通过中指办分配的账号进行登录', '1', '3', '0');
INSERT INTO `consult` VALUES ('23', '本网站哪里可以查阅到《地方志工作条例》？', '江卉', '0713-3324231', 'hmxzb2006@163.com', '黄梅县史志研究中心', '本网站作为中国地方志指导小组官网，没有查阅到《地方志工作条例》等地方志法规、规范性文件', '2019-12-23 10:29:36', '2019-12-23 11:03:44', 'http://difangzhi.cssn.cn/flfg/fggh/200804/t20080409_4945775.shtml。您可通过站内搜索，找到关于《地方志工作条例》有关信息。', '1', '1', '0');
INSERT INTO `consult` VALUES ('24', '名镇志编纂出版咨询', '袁忠稳', '13330576011', '1046177810@qq.com', '云南省宣威市田坝镇一中', '我曾经编纂《田坝镇志》（古代--2013），初稿已成。由于镇政府没有出版经费，志书出版被搁置下来。但我不甘心，因为镇的发展脉络中，可以看到社会主义制度的完善过程。人民公社时期，有口粮与工分粮之别；改革开放时期，有基本工资和绩效工资之别。社会主义的优越性就是各尽所能，物物得所，基本保障全覆盖。我想把我编纂的《田坝镇志》申格进入中华名镇志编纂系列，如何争取当地政府的支持，如何求得中指办的指导呢？', '2019-12-23 15:26:21', '2019-12-23 16:01:53', '请您与所在县地方志办公室联系。', '1', '3', '0');
INSERT INTO `consult` VALUES ('25', '江苏省泗阳县地方志办公室联系电话', '黄镜天', '15977010288', 'hjtzg@126.com', '广西浦北县地方志办公室', '江苏省泗阳县地方志办公室联系电话', '2019-12-23 17:05:20', '2019-12-26 10:57:52', '您好，我单位不掌握县级单位具体联系方式，请通过当地政府部门或查号寻找。谢谢', '1', '3', '0');
INSERT INTO `consult` VALUES ('26', '关于地方志图书问题。', '郭兴', '13125512518', '1547864246@qq.com', null, '最近有电话自称是中国地方志小组工作人员柳峰，让我们订阅《地方志编纂工作规范化管理实用全书》，998元4本。请问是否确有其事？请地方志小组澄清。', '2019-12-30 10:58:27', '2019-12-30 12:54:14', '您好，中指办没有叫这个名字的工作人员，中指办也从不会向各地作商业推销。请您谨慎辨别，以防受骗。', '1', '1', '0');
INSERT INTO `consult` VALUES ('27', '《中国地方志》杂志投稿邮箱', '施敏锋', '13511230539', 'jdshiminfeng@163.com', '湖州职业技术学院', '您好，请问《中国地方志》杂志的投稿邮箱是多少？盼告知，不胜感激', '2020-01-05 19:25:16', '2020-01-08 08:54:37', '《中国地方志》已经实现网上投稿、审稿，无法通过邮箱投稿。您可以通过http://www.zgdfz.cn/投稿。', '1', '3', '0');
INSERT INTO `consult` VALUES ('28', '关于增加地方志相关条例、规定板块的内容', '韩方宇', '13050599917', '13050599917@163.com', null, '作为一个刚参加史志工作的新人，熟悉了解地方志相关条例、规定十分重要，但是作为全国地方志工作的网站，竟然没有一个条例、规定的板块，难以理解。《关于地方综合年鉴编纂出版若干问题的补充规定》我在网上始终没有找到。我太难了！无规矩不成方圆，先从基本制度入手，才是一切工作的良好开端。', '2020-01-07 11:24:27', '2020-01-08 08:57:43', '您可以通过“政策法规”栏目查询：http://www.difangzhi.cn/flfg/fggh/', '1', '3', '0');
INSERT INTO `consult` VALUES ('29', '需要近期的全国方志馆建设情况统计表', '刘明霞', '13306458879', '174679364@qq.com', '烟台市方志馆', '烟台市方志馆启动建设筹备中，需要一些数据', '2020-02-09 20:14:42', '2020-02-12 17:14:36', '行业数据可以在中国方志网-在线下载-统计数据中查询，也可以通过中国方志网查找国家方志馆相关部门咨询', '1', '3', '0');
INSERT INTO `consult` VALUES ('30', '济宁市地方史志办和地方党史办合并，全国都是这样的吗？出于什么考虑？', '韦科', '18513041341', '86988862@qq.com', null, '据我了解，山东省济宁市地方史志办和地方党史办合并，请问全国都是这样的吗？出于什么考虑？', '2020-02-25 20:41:44', '2020-02-28 16:08:52', '不是的，但全国机构改革，确实有多个省份合并，这是各省响应深化党和国家机构改革号召的举措', '1', '3', '0');
INSERT INTO `consult` VALUES ('31', '在哪里下载名山、名水、名街志文化工程的文件和附件', '张孜平', '13938171118', 'jyszb@126.com', '河南济源史志办', '我是济源市史志办副主任张孜平，济源是愚公移山寓言故事中王屋山所在地，同时也是四渎之一济水的源头所在地，还有全国著名“引沁（沁河）济漭（漭河）”水利工程（工程量、施工难度、发挥作用堪比红旗渠）。因此我们想申报名山名水志。不知道在哪里下载具体文件和附件（特别是附件）', '2020-02-27 10:49:13', '2020-03-03 17:15:18', '在中国方志网通知公告栏里。2018-06-29发布，名山、名水、名街等实施工作方案通知', '1', '3', '0');
INSERT INTO `consult` VALUES ('32', '在哪里下载名山、名水、名街志文化工程的文件和附件', '张孜平', '13938171118', 'jyszb@126.com', '河南济源史志办', '我是济源市史志办副主任张孜平，济源是愚公移山寓言故事中王屋山所在地，同时也是四渎之一济水的源头所在地，还有全国著名“引沁（沁河）济漭（漭河）”水利工程（工程量、施工难度、发挥作用堪比红旗渠）。因此我们想申报名山名水志。不知道在哪里下载具体文件和附件（特别是附件）', '2020-02-27 10:52:37', null, null, '2', '2', '0');
INSERT INTO `consult` VALUES ('33', '求  关于印发《国家方志馆分馆建设管理工作规定》的通知  　　中指组字〔2018〕12号  正式文件PDF版', '曾牧野', '0731-81859799', '996927684@qq.com', '长沙市地方志编纂室', '因申报国家方志馆近代人物分馆工作的需要，求 关于印发《国家方志馆分馆建设管理工作规定》的通知（中指组字〔2018〕12号）正式文件PDF版，感谢感谢！', '2020-03-02 10:48:27', '2020-03-04 08:55:02', '正式文件都在秘书处，文件类的，我们顶多有空开信息，发网上那种版本的，只有内容。我咨询一下秘书处或者方志馆在发您把', '1', '3', '0');
INSERT INTO `consult` VALUES ('34', '注册后登录显示密码错误', '曾苏苡', '13872191615', '420121613@qq.com', null, '今天在线投稿连续注册两次，换了两个邮箱，都不能登陆成功，提示我密码错误，想询问是否为系统出了问题', '2020-03-08 11:36:09', '2020-03-09 09:01:35', '感谢您的反馈，我和运维公司处理一下', '1', '3', '0');
INSERT INTO `consult` VALUES ('35', '核实数据', '廖滔', '17772359241', '534611620@qq.com', '重庆市九龙坡区地方志编纂中心', '您好！编写方志馆材料所需，需向贵单位核实部分数据，烦请指正。\n文段如下：\n“自1990年中国第一家方志馆浙江方志馆成立，全国已经建成国家、省、市、县各级方志馆600余家，其中国家方志馆1家、国家方志馆分馆2家、省市级方志馆100余家。”\n具体事项：\n以上文字的数据表述是否准确，如不准确贵方是否有准确数据（最好是能精确到个位），烦请指导。\n十分感谢！', '2020-03-16 10:05:47', '2020-03-19 09:30:37', '您好，历年方志馆数据在方志网在线服务中的统计数据中都有。您可以点开来看。\nhttp://www.difangzhi.cn/zxfw/tjsj/201904/t20190419_4939907.shtml\n具体内容，如有不清楚的，可以联系国家方志馆综合部。\n联系方式在组织机构中，点击，中国地方志指导小组办公室（国家方志馆）\nhttp://www.difangzhi.cn/zzjg/jgsz/200804/t20080409_4940612.shtml', '1', '3', '0');
INSERT INTO `consult` VALUES ('36', '请问，截至2020年1月1日，全国国家方志馆分馆有几家？', '刘柏林', '15086747872', '316514587@qq.com', '重庆市九龙坡区地方志编纂中心', '因重庆九龙坡区想申请建设国家方志馆长江分馆，为此咨询您，目前国家方志馆1家、国家方志馆分馆有多少家？（如黄河分馆、知情分馆、秦皇岛分馆、中原分馆、南水北调分馆、特区分馆，但不知道哪些已建成）。', '2020-03-18 10:15:24', '2020-03-19 09:31:37', '方志馆具体内容，可以联系国家方志馆综合部。\n联系方式在组织机构中，点击，中国地方志指导小组办公室（国家方志馆）\nhttp://www.difangzhi.cn/zzjg/jgsz/200804/t20080409_4940612.shtml', '1', '3', '0');
INSERT INTO `consult` VALUES ('37', '贵州省地方志办', '孔垂栋', '085185530094', '94303102@qq.com', '贵州省地方志办', '贵州档案信息网（域名：www.gzdaxx.gov.cn）和贵州地方志信息网（域名：www.gzdfzxx.gov.cn）整合成贵州档案方志信息网（域名：www.gzdafzxx.cn）。新域名（www.gzdafzxx.cn）将于2020年4月1日正式启用，原域名（www.gzdaxx.gov.cn和www.gzdfzxx.gov.cn）将于3月31日停止使用，由此造成的不便敬请谅解。', '2020-03-20 14:45:39', '2020-03-23 10:25:39', '收到', '1', '3', '0');
